function hashString(userString) {
    let hash = 0;
    for (let i = 0; i < userString.length; i++) {
        const char = userString.charCodeAt(i);
        hash = (hash << 5) - hash + char;
        hash = hash & hash;
    }
    return hash;
}
    
function seededRandom(seed) {
var x = Math.sin(seed) * 10000;
return x - Math.floor(x);
}
    
